css:
@-moz-document domain("rusdtp.ru") {
body {
background-image: url("https://i.ibb.co/D5m7TVW/h-1523207183-7762604-160eb1d963.jpg") !important;
	background-color: #111 !important;
	background-attachment: fixed !important;
	background-clip: border-box !important;
	background-origin: padding-box !important;
	background-position: center center !important;
	background-repeat: no-repeat !important;
background-size: cover !important;
}
a:link, a:visited, a:active {
	color: #0099ff !important;
}
a:hover {
    color: #00ffff !important;
    box-shadow: 0 0 50px #00beff;
    border-radius: 5px !important;
}
* {
    background-color: transparent !important;           
	color: #ccc !important;
    border-color: #696D7D !important;
    -webkit-transition: background-color .3s !important;                                                                 
    -moz-transition: background-color .3s !important;
    -ms-transition: background-color .3s !important;
    -o-transition: background-color .3s !important;
    transition: background-color .3s !important;
}                                            
.mainnav, #tit-m, .m-top, .m-bottom {
background: url('data:image/png;base64,') no-repeat !important;
    background-size: 100% !important;
    color: #00ffff !important; 
}
.infoe, .pope, .title_quote, .maintitle, .bb-pane, .ui-dialog-titlebar, .button  {
    background: url('data:image/png;base64,') no-repeat !important; 
   background-size: cover !important;
}
#tit-l, #tit-r, .m-center, .lcomm-item, .quote, .lcomm-hidden, .ipbtable td, .divpad, #dle-comments-form textarea, #footer, .subnav li, .ui-dialog-content, button {
    background: none repeat scroll 0 0 rgba(0, 7, 27, 0.7) !important;
	box-shadow: 0 0 50px #003366;	
	border-radius: 5px !important;
	-webkit-border-radius: 5px !important;
	-moz-border-radius: 5px !important;
	-khtml-border-radius: 5px !important;
}
.formbuttonrow img[alt="Вставка цитаты"] {
	background: url('https://s.4pda.to/forum/style_images/f/607-citata.png') !important;
	height: 21px !important;
	padding-right: 92px !important;
	width: 0 !important;
}
